import React, { useState } from 'react';
import './App.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUpload, faPlay, faStar } from '@fortawesome/free-solid-svg-icons';

function App() {
  const [fileName, setFileName] = useState("No file selected");
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);
  const [file, setFile] = useState(null);

  const handleFileChange = (e) => {
    const selectedFile = e.target.files[0];
    if (selectedFile) {
      setFile(selectedFile);
      setFileName(selectedFile.name);
    }
  };

  const handleAnalyze = async () => {
    if (!file) return;
    setLoading(true);

    const formData = new FormData();
    formData.append('file', file);

    try {
      const response = await fetch('http://localhost:5000/analyze', {
        method: 'POST',
        body: formData,
      });

      const data = await response.json();
      setResult({
        bestMatch: {
          title: data.best_match.role,
          percentage: data.best_match.percentage
        },
        scores: data.match_percentages
      });
    } catch (error) {
      console.error("Error analyzing resume:", error);
    }

    setLoading(false);
  };

  return (
    <div className="app">
      <section className="hero-section">
        <h1>
          <FontAwesomeIcon icon={faStar} className="logo-icon" /> Smart Resume Analyzer
        </h1>
        <p>Upload your resume to get matched with the best-fit job roles!</p>
      </section>

      <div className="upload-card">
        <label className="file-label">
          <input type="file" onChange={handleFileChange} />
          <FontAwesomeIcon icon={faUpload} size="2x" />
          <span>Select Resume File</span>
          <em className="filename">{fileName}</em>
        </label>
      </div>

      <button
        className="analyze-button"
        onClick={handleAnalyze}
        disabled={loading || !file}
      >
        <FontAwesomeIcon icon={faPlay} style={{ marginRight: "8px" }} />
        {loading ? 'Analyzing...' : 'Analyze Resume'}
      </button>

      {loading && <div className="loader"></div>}

      {result && !loading && (
        <section className="results-section">
          <div className="best-match-card">
            <h2>Top Match</h2>
            <p>{result.bestMatch.title}</p>
            <p>{result.bestMatch.percentage}% match</p>
          </div>

          <div className="match-list-card">
            <h3>Match Percentages</h3>
            <ul>
              {Object.entries(result.scores).map(([role, value]) => (
                <li key={role}>
                  <span className="role">{role}</span>
                  <div className="progress-bar">
                    <div
                      className="progress-fill"
                      style={{
                        width: `${value}%`,
                        backgroundColor: getBarColor(value),
                      }}
                    ></div>
                  </div>
                  <span className="percent">{value}%</span>
                </li>
              ))}
            </ul>
          </div>
        </section>
      )}
    </div>
  );
}

function getBarColor(value) {
  if (value === 0) return '#ccc';
  if (value >= 80) return '#38b000'; // green
  if (value >= 60) return '#00b4d8'; // blue
  if (value >= 30) return '#fcbf49'; // amber
  return '#ef476f'; // red
}

export default App;
